pragma solidity ^0.6.6;

import {NetworkAgnostic} from "./common/NetworkAgnostic.sol";

contract PrivateEvent is NetworkAgnostic {

    constructor() NetworkAgnostic("PrivateEvent", "1", 5) public {}

    event eventIsFinish(int256 question_id, uint8 correctAnswer);

    struct Participant {
        address payable participants;
    }

    struct EventData {
        uint256 event_id;
        uint256 startTime;
        uint256 endTime;
        uint8 correctAnswer;
        mapping(uint256 => Participant[]) participant;
        string winner;
        string loser;
        uint8 questionQuantity;
        address payable host;
        address payable correctAnswerSetter;
    }

    mapping(int256 => EventData) events;

    function createEvent(
        int256 _question_id,
        uint256 _startTime,
        uint256 _endTime,
        string memory _winner,
        string memory _loser,
        uint8 _questionQuantity,
        address payable _correctAnswerSetter
    ) public payable {
        events[_question_id].startTime = _startTime;
        events[_question_id].endTime = _endTime;
        events[_question_id].host = _msgSender();
        events[_question_id].correctAnswerSetter = _correctAnswerSetter;
        events[_question_id].questionQuantity = _questionQuantity;
        events[_question_id].winner = _winner;
        events[_question_id].loser = _loser;
    }

    function setRoleOfAdmin(
        int256 _question_id,
        address payable _correctAnswerSetter
    ) public payable {
        require(
            _msgSender() == events[_question_id].host,
            "Only owner can set admin of event"
        );
        events[_question_id].correctAnswerSetter = _correctAnswerSetter;
    }

    function setAnswer(int256 _question_id, uint8 _whichAnswer) public payable {
        require(timeAnswerValidation(_question_id) == 0, "Time is not valid");
        Participant memory parts;
        parts = Participant(_msgSender());
        events[_question_id].participant[_whichAnswer].push(parts);
    }

    function setCorrectAnswer(int256 _question_id, uint8 _correctAnswer) public payable{
        // require(
        //     _msgSender() == events[_question_id].correctAnswerSetter,
        //     "Only admin can set correct answer"
        // );
        require(timeAnswerValidation(_question_id) == 2, "Time is not valid");
        events[_question_id].correctAnswer = _correctAnswer;

         emit eventIsFinish(_question_id, _correctAnswer);
    }


    function timeAnswerValidation(int256 _question_id) public view returns (int8) {
        if (int256(now - events[_question_id].startTime) >= 0) {
            if (int256(events[_question_id].endTime - now) >= 0) {
                // user can make answer because time is valid.
                return 0;
            } else {
                // user can't make answer because event is finish.
                return 2;
            }
        } else {
            // user can't make answer because event is not started yet.
            return 1;
        }
    }

     function _msgSender() internal view returns (address payable sender) {
        if(msg.sender == address(this)) {
            bytes memory array = msg.data;
            uint256 index = msg.data.length;
            assembly {
                // Load the 32 bytes word from memory with the address on the lower 20 bytes, and mask those.
                sender := and(mload(add(array, index)), 0xffffffffffffffffffffffffffffffffffffffff)
            }
        } else {
            sender = msg.sender;
        }
        return sender;
    }
}
